import React, { Component } from "react";
import {
  View,
  Text,
  SafeAreaView,
  FlatList,
  Platform,
  StatusBar,
  ScrollView,
  Image,
  Dimensions,
} from "react-native";
import { LinearGradient } from "expo-linear-gradient";
import Icon from "react-native-vector-icons/Ionicons";
import Home from "./home";
const { height, width } = Dimensions.get("window");
var screenHeight = Math.round(Dimensions.get("window").height) / 100;
var specifics;
export default class cat extends Component {
  state = {
    skill: "Musical Instrument",
    specifics: [],
    columnCount: 1,
  };
  async componentDidMount() {
    if (this.state.skill == "Coding")
      specifics = [
        {
          name: "FrontEnd Development",
          image: "https://img-a.udemycdn.com/course/750x422/2314744_c707.jpg",
          price: 30,
        },
        {
          name: "BackEnd Development",
          image:
            "https://qphs.fs.quoracdn.net/main-qimg-c02d737b627c8346adddd33fbcfb442e",
          price: 30,
        },
        {
          name: "Web Development",
          image:
            "https://sitegalleria.com/wp-content/uploads/2019/08/Web-Development-Company-Bangalore.jpeg",
          price: 30,
        },
        {
          name: "Mobile Development",
          image:
            "https://miro.medium.com/max/1000/1*ZnVbmWK9nAothEg_de2fOA.jpeg",
          price: 30,
        },
        {
          name: "Interview Prep",
          image:
            "https://stepupanalytics.com/wp-content/uploads/2018/07/competitive-programming-data-structures-and-algorithms.gif",
          price: 30,
        },
        {
          name: "Java",
          image:
            "https://crbtech.in/wp-content/uploads/2016/11/Want-To-Become-The-Most-Successful-Java--1200x600.jpg",
          price: 30,
        },
        {
          name: "JavaScript",
          image:
            "https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcTdSijhcOjGCo17mTM5jRVAegCvvdGylghE5g&usqp=CAU",
          price: 30,
        },
        {
          name: "Python",
          image: "https://miro.medium.com/max/836/0*gHid-f4RB4mMZTBl.jpg",
          price: 30,
        },
      ];
    if (this.state.skill == "Musical Instrument")
      specifics = [
        {
          name: "Guitar",
          image: "https://img-a.udemycdn.com/course/750x422/2314744_c707.jpg",
          price: 30,
        },
        {
          name: "Piano",
          image:
            "https://qphs.fs.quoracdn.net/main-qimg-c02d737b627c8346adddd33fbcfb442e",
          price: 30,
        },
        {
          name: "Dhrum",
          image:
            "https://sitegalleria.com/wp-content/uploads/2019/08/Web-Development-Company-Bangalore.jpeg",
          price: 30,
        },
        {
          name: "Table",
          image:
            "https://miro.medium.com/max/1000/1*ZnVbmWK9nAothEg_de2fOA.jpeg",
          price: 30,
        },
      ];
    await this.setState({ specifics });
    if (this.state.specifics.length > 4) {
      console.log("enter");
      this.setState({ columnCount: 2 });
    }
  }
  display = (item) => {
    return (
      <Home
        width={width}
        name={item.name}
        image={item.image}
        type="PRIVATE ROOM - 2 BEDS"
        price={item.price}
        rating={4}
      />
    );
  };
  render() {
    return (
      <LinearGradient
        colors={["#09C6F9", "#045DE9"]}
        start={{ x: 1, y: 0 }}
        end={{ x: 0, y: 1 }}
        style={{ height: screenHeight * 100 }}
      >
        <SafeAreaView style={{ flex: 1 }}>
          <View style={{ flex: 1 }}>
            <ScrollView scrollEventThrottle={16}>
              <View style={{ marginTop: 20 }}>
                <Text
                  style={{
                    fontSize: 30,
                    fontWeight: "700",
                    color: "white",
                    alignSelf: "center",
                  }}
                >
                  Coding
                </Text>
                <FlatList
                  // horizontal={true}
                  numColumns={this.state.columnCount}
                  key={this.state.columnCount}
                  data={this.state.specifics}
                  renderItem={({ item }) => this.display(item)}
                />
              </View>
            </ScrollView>
          </View>
        </SafeAreaView>
      </LinearGradient>
    );
  }
}
